<body bgcolor="#A0A0A0" vlink="blue" link="blue">
<div id="page1-div" style="position:relative;width:892px;height:1262px;">
<img width="892" height="1263" src="data:image/png;base64," />
<p style="position:absolute;top:106px;left:560px;white-space:nowrap" class="ft10">Інформаційно-сервісна служба:&#160;</p>
<p style="position:absolute;top:106px;left:750px;white-space:nowrap" class="ft10">0 800 21 78 87</p>
<p style="position:absolute;top:1077px;left:74px;white-space:nowrap" class="ft11">Ліцензія МОЗ України АД №071280 від 22.11.2012 г. &#160; &#160;Т</p>
<p style="position:absolute;top:842px;left:74px;white-space:nowrap" class="ft11">ОВ «МЛ «ДІЛА» сертифіковано згідно вимог міжнародног</p>
<p style="position:absolute;top:603px;left:74px;white-space:nowrap" class="ft11">о ст</p>
<p style="position:absolute;top:587px;left:74px;white-space:nowrap" class="ft11">андарту ISO 9001 &#160;Акредит</p>
<p style="position:absolute;top:474px;left:74px;white-space:nowrap" class="ft11">аційний сертифіка</p>
<p style="position:absolute;top:399px;left:74px;white-space:nowrap" class="ft11">т вищої ка</p>
<p style="position:absolute;top:356px;left:74px;white-space:nowrap" class="ft11">тег</p>
<p style="position:absolute;top:343px;left:74px;white-space:nowrap" class="ft11">орії МОЗУ МЗ № 014792 від 27.03.2020</p>
<p style="position:absolute;top:73px;left:226px;white-space:nowrap" class="ft12">Атестат про акредитацію відповідно до ДСТУ EN ISO 15189:2015 (EN ISO 15189: 2012,&#160;IDT) № 30001 від 04.09.2020 р.</p>
<p style="position:absolute;top:698px;left:131px;white-space:nowrap" class="ft115">Дане дослідження призначене для виявлення антигену вірусу&#160;SARS-CoV-2.&#160;Для оцінки імунної відповіді рекомендовані&#160;<br/>дослідження на виявлення антитіл.</p>
<p style="position:absolute;top:744px;left:131px;white-space:nowrap" class="ft13">Інформаційна підтримка Контакт-центру ДІЛА: 0 800 217 887.</p>
<p style="position:absolute;top:600px;left:131px;white-space:nowrap" class="ft115">У разі збереження підозри на інфікування, наявності ознак ГРВЗ чи проявів схожих на коронавірусну хворобу,&#160;<br/>рекомендується:<br/>&#160;- дотримуватися заходів безпеки &#160;(користуватися засобами індивідуального захисту, дотримуватись соціальної дистанції);<br/>&#160;- звернутися до лікаря та отримати рекомендації щодо повторного тестування із застосуванням іншого методу&#160;(RT-ПЛР з&#160;<br/>дослідженням того ж або іншого біоматеріалу).</p>
<p style="position:absolute;top:539px;left:131px;white-space:nowrap" class="ft14"><b>Заключення:</b></p>
<p style="position:absolute;top:540px;left:215px;white-space:nowrap" class="ft15"><b>&#160;</b></p>
<p style="position:absolute;top:557px;left:131px;white-space:nowrap" class="ft115">У зразку біологічного матеріалу, обстеженого швидким тестом для виявлення специфічних антигенів, не встановлена&#160;<br/>наявність антигену вірусу&#160;SARS-CoV-2.</p>
<p style="position:absolute;top:794px;left:373px;white-space:nowrap" class="ft116">Завідувач лабораторії&#160;<br/>загальноклінічного аналізу</p>
<p style="position:absolute;top:794px;left:666px;white-space:nowrap" class="ft17"><b>Несененко О.В.</b></p>
<p style="position:absolute;top:412px;left:179px;white-space:nowrap" class="ft14"><b>Назва дослідження</b></p>
<p style="position:absolute;top:412px;left:398px;white-space:nowrap" class="ft14"><b>Результат</b></p>
<p style="position:absolute;top:403px;left:520px;white-space:nowrap" class="ft14"><b>Одиниці&#160;</b></p>
<p style="position:absolute;top:421px;left:527px;white-space:nowrap" class="ft14"><b>виміру</b></p>
<p style="position:absolute;top:403px;left:619px;white-space:nowrap" class="ft14"><b>Референтні&#160;</b></p>
<p style="position:absolute;top:421px;left:628px;white-space:nowrap" class="ft14"><b>значення</b></p>
<p style="position:absolute;top:412px;left:751px;white-space:nowrap" class="ft14"><b>Коментарi</b></p>
<p style="position:absolute;top:442px;left:131px;white-space:nowrap" class="ft117"><b>Коронавірус&#160;(SARS-Cov-2), COVID-<br/>19,&#160;швидкий тест для виявлення&#160;<br/>АГ, якісний</b></p>
<p style="position:absolute;top:497px;left:131px;white-space:nowrap" class="ft115">Первинна проба:&#160;мазок&#160;<br/>назоорофарингіальний</p>
<p style="position:absolute;top:477px;left:389px;white-space:nowrap" class="ft19"><b>не виявлено</b></p>
<p style="position:absolute;top:478px;left:623px;white-space:nowrap" class="ft13">не виявлено</p>
<p style="position:absolute;top:199px;left:370px;white-space:nowrap" class="ft110"><b>РЕЗУЛЬТАТИ ДОСЛІДЖЕНЬ</b></p>
<p style="position:absolute;top:254px;left:131px;white-space:nowrap" class="ft18"><b>Пацієнт:</b></p>
<p style="position:absolute;top:254px;left:234px;white-space:nowrap" class="ft18"><b>Чернишенко Олександр Валентинович</b></p>
<p style="position:absolute;top:254px;left:573px;white-space:nowrap" class="ft18"><b>Лаб.&#160;№&#160;замовлення</b></p>
<p style="position:absolute;top:254px;left:749px;white-space:nowrap" class="ft18"><b>649981638</b></p>
<p style="position:absolute;top:279px;left:131px;white-space:nowrap" class="ft18"><b>Дата народж.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</b>05.06.1982</p>
<p style="position:absolute;top:279px;left:573px;white-space:nowrap" class="ft18"><b>Код замовлення:</b></p>
<p style="position:absolute;top:279px;left:781px;white-space:nowrap" class="ft111">-</p>
<p style="position:absolute;top:305px;left:131px;white-space:nowrap" class="ft18"><b>Стать:</b></p>
<p style="position:absolute;top:305px;left:234px;white-space:nowrap" class="ft111">Чоловіча</p>
<p style="position:absolute;top:305px;left:573px;white-space:nowrap" class="ft18"><b>Дата взяття зразка:</b></p>
<p style="position:absolute;top:305px;left:734px;white-space:nowrap" class="ft111">{{$yesterday}} 10:17</p>
<p style="position:absolute;top:330px;left:131px;white-space:nowrap" class="ft112"><i><b>Коментарі:</b></i></p>
<p style="position:absolute;top:330px;left:573px;white-space:nowrap" class="ft118"><i>Відділення&#160;№023&#160;м. Київ, вул. М.&#160;<br/>Цвєтаєвої, 13</i></p>
<p style="position:absolute;top:1195px;left:131px;white-space:nowrap" class="ft114"><i>символом * позначаються результати, що виходять за межі референтних значень&#160;</i></p>
<p style="position:absolute;top:1220px;left:491px;white-space:nowrap" class="ft16">№&#160;зам.:<b>&#160;</b>&#160;649981638</p>
<p style="position:absolute;top:1219px;left:131px;white-space:nowrap" class="ft16">Пацієнт:&#160;Чернишенко Олександр Валентинович</p>
<p style="position:absolute;top:1220px;left:622px;white-space:nowrap" class="ft16">Дата друку:&#160;{{$yesterday}} 11:44</p>
<p style="position:absolute;top:1220px;left:817px;white-space:nowrap" class="ft16">c.1&#160;з 2</p>
</div>
