<body bgcolor="#A0A0A0" vlink="blue" link="blue">
<div id="page2-div" style="position:relative;width:892px;height:1262px;">
<img width="892" height="1263" src="data:image/png;base64," />
<p style="position:absolute;top:106px;left:560px;white-space:nowrap" class="ft20">Інформаційно-сервісна служба:&#160;</p>
<p style="position:absolute;top:106px;left:750px;white-space:nowrap" class="ft20">0 800 21 78 87</p>
<p style="position:absolute;top:1077px;left:74px;white-space:nowrap" class="ft21">Ліцензія МОЗ України АД №071280 від 22.11.2012 г. &#160; &#160;Т</p>
<p style="position:absolute;top:842px;left:74px;white-space:nowrap" class="ft21">ОВ «МЛ «ДІЛА» сертифіковано згідно вимог міжнародног</p>
<p style="position:absolute;top:603px;left:74px;white-space:nowrap" class="ft21">о ст</p>
<p style="position:absolute;top:587px;left:74px;white-space:nowrap" class="ft21">андарту ISO 9001 &#160;Акредит</p>
<p style="position:absolute;top:474px;left:74px;white-space:nowrap" class="ft21">аційний сертифіка</p>
<p style="position:absolute;top:399px;left:74px;white-space:nowrap" class="ft21">т вищої ка</p>
<p style="position:absolute;top:356px;left:74px;white-space:nowrap" class="ft21">тег</p>
<p style="position:absolute;top:343px;left:74px;white-space:nowrap" class="ft21">орії МОЗУ МЗ № 014792 від 27.03.2020</p>
<p style="position:absolute;top:73px;left:226px;white-space:nowrap" class="ft22">Атестат про акредитацію відповідно до ДСТУ EN ISO 15189:2015 (EN ISO 15189: 2012,&#160;IDT) № 30001 від 04.09.2020 р.</p>
<p style="position:absolute;top:199px;left:252px;white-space:nowrap" class="ft23"><b>ТЕСТ НА ВИЗНАЧЕННЯ АНТИГЕНУ вірусу&#160;&#160;SARS-COV-2&#160;</b></p>
<p style="position:absolute;top:224px;left:231px;white-space:nowrap" class="ft24"><b>призначений для виявлення/ідентифікації в зразку біоматеріалу&#160;</b></p>
<p style="position:absolute;top:246px;left:214px;white-space:nowrap" class="ft24"><b>(мазку з рото-, носоглотки) специфічного білка&#160;N,&#160;що належить вірусу</b></p>
<p style="position:absolute;top:280px;left:131px;white-space:nowrap" class="ft25"><b>ДАНИЙ ВИД ТЕСТУВАННЯ РЕКОМЕНДУЄТЬСЯ ДЛЯ ПРОВЕДЕННЯ:</b></p>
<p style="position:absolute;top:304px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:304px;left:137px;white-space:nowrap" class="ft27">&#160;якщо Вам потрібна&#160;</p>
<p style="position:absolute;top:304px;left:253px;white-space:nowrap" class="ft28">довідка для відвідування громадських місць;</p>
<p style="position:absolute;top:322px;left:131px;white-space:nowrap" class="ft29">•</p>
<p style="position:absolute;top:322px;left:137px;white-space:nowrap" class="ft27">&#160;в країнах з високим рівнем поширення&#160;COVID-19;</p>
<p style="position:absolute;top:340px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:340px;left:137px;white-space:nowrap" class="ft27">&#160;коли немає можливості здати тест ПЛР;</p>
<p style="position:absolute;top:358px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:358px;left:137px;white-space:nowrap" class="ft27">&#160;особам, які перебувають у закритих колективах (інтернати, будинки для людей похилого віку);</p>
<p style="position:absolute;top:376px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:376px;left:137px;white-space:nowrap" class="ft27">&#160;тим, хто піддається постійному ризику інфікування (медпрацівники, персонал лікарень, людям, що доглядають за&#160;</p>
<p style="position:absolute;top:392px;left:131px;white-space:nowrap" class="ft27">хворими)*;</p>
<p style="position:absolute;top:410px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:410px;left:137px;white-space:nowrap" class="ft27">&#160;в екстрених випадках (тяжкість перебігу не дозволяє чекати результатів ПЛР);&#160;</p>
<p style="position:absolute;top:429px;left:131px;white-space:nowrap" class="ft26"><b>•</b></p>
<p style="position:absolute;top:429px;left:137px;white-space:nowrap" class="ft27">&#160;за вимогою посольств для перетину кордону.</p>
<p style="position:absolute;top:459px;left:160px;white-space:nowrap" class="ft210"><b>Результат</b></p>
<p style="position:absolute;top:459px;left:316px;white-space:nowrap" class="ft210"><b>Є симптоми захворювання</b></p>
<p style="position:absolute;top:459px;left:596px;white-space:nowrap" class="ft210"><b>Немає симптомів захворювання</b></p>
<p style="position:absolute;top:545px;left:148px;white-space:nowrap" class="ft211"><b>Позитивний</b></p>
<p style="position:absolute;top:484px;left:258px;white-space:nowrap" class="ft220"><b>Людина інфікована&#160;COVID-19,&#160;високозаразна для&#160;<br/>оточення.&#160;<br/>Рекомендується:</b>&#160;</p>
<p style="position:absolute;top:534px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:534px;left:264px;white-space:nowrap" class="ft213">&#160;спостереження лікаря;</p>
<p style="position:absolute;top:552px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:552px;left:264px;white-space:nowrap" class="ft213">&#160;при наявності факторів ризику (вік, супутні&#160;</p>
<p style="position:absolute;top:566px;left:258px;white-space:nowrap" class="ft221">хвороби/стани*) провести Комплекс&#160;«Оцінка стану&#160;<br/>організму при&#160;COVID-19»;</p>
<p style="position:absolute;top:599px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:599px;left:264px;white-space:nowrap" class="ft213">&#160;через 10-14 днів здати ПЛР тест.</p>
<p style="position:absolute;top:484px;left:556px;white-space:nowrap" class="ft219"><b>Результат розцінюється як попередньо позитивний,&#160;<br/>якщо є дані:&#160;</b></p>
<p style="position:absolute;top:516px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:516px;left:562px;white-space:nowrap" class="ft215"><b>&#160;</b></p>
<p style="position:absolute;top:516px;left:564px;white-space:nowrap" class="ft213">про контакт з хворим&#160;COVID-19;</p>
<p style="position:absolute;top:534px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:534px;left:562px;white-space:nowrap" class="ft213">&#160;про перебування в місцях/країнах з високим ризиком&#160;</p>
<p style="position:absolute;top:549px;left:556px;white-space:nowrap" class="ft213">інфікування;</p>
<p style="position:absolute;top:578px;left:556px;white-space:nowrap" class="ft221">Для підтвердження необхідно здати ПЛР тест через 24&#160;<br/>години (але не пізніше 48 годин).</p>
<p style="position:absolute;top:731px;left:149px;white-space:nowrap" class="ft216"><b>Негативний</b></p>
<p style="position:absolute;top:631px;left:258px;white-space:nowrap" class="ft212"><b>Може означати, що:</b>&#160;</p>
<p style="position:absolute;top:649px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:649px;left:264px;white-space:nowrap" class="ft213">&#160;кількість вірусів у носоглотці нижче межі чутливості&#160;</p>
<p style="position:absolute;top:664px;left:258px;white-space:nowrap" class="ft213">експрес тесту;&#160;</p>
<p style="position:absolute;top:682px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:682px;left:264px;white-space:nowrap" class="ft213">&#160;захворювання викликане іншими респіраторними&#160;</p>
<p style="position:absolute;top:696px;left:258px;white-space:nowrap" class="ft213">вірусами;</p>
<p style="position:absolute;top:711px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:711px;left:264px;white-space:nowrap" class="ft213">&#160;при повторному взятті мазка через короткий проміжок&#160;</p>
<p style="position:absolute;top:726px;left:258px;white-space:nowrap" class="ft222">часу (день в день або через добу), що зменшує кількість&#160;<br/>біоматеріалу в зразку і в свою чергу може призводити&#160;<br/>до негативних результатів.<br/><b>Рекомендується здати:&#160;</b></p>
<p style="position:absolute;top:787px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:787px;left:264px;white-space:nowrap" class="ft213">&#160;ПЛР тест на визначення&#160;SARS-COV-2**;</p>
<p style="position:absolute;top:805px;left:258px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:805px;left:264px;white-space:nowrap" class="ft213">&#160;Скринінг для визначення 21 збудника методом ПЛР в&#160;</p>
<p style="position:absolute;top:820px;left:258px;white-space:nowrap" class="ft221">тому числі грипу з використанням запатентованої&#160;<br/>європейської методики&#160;FTD ***.</p>
<p style="position:absolute;top:631px;left:556px;white-space:nowrap" class="ft220"><b>Відсутність інфікування&#160;SARS-COV-2<br/></b>Не виключає інфікування&#160;COVID-19&#160;у випадках:&#160;</p>
<p style="position:absolute;top:667px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:667px;left:562px;white-space:nowrap" class="ft213">&#160;у тих, хто контактував з хворим, що має підтверджений&#160;</p>
<p style="position:absolute;top:682px;left:556px;white-space:nowrap" class="ft213">COVID-19;&#160;</p>
<p style="position:absolute;top:699px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:699px;left:562px;white-space:nowrap" class="ft213">&#160;у тих, хто постійно контактує з хворими;&#160;</p>
<p style="position:absolute;top:717px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:717px;left:562px;white-space:nowrap" class="ft213">&#160;у тих, хто проживає у місцях з високим рівнем&#160;</p>
<p style="position:absolute;top:732px;left:556px;white-space:nowrap" class="ft213">поширення коронавірусної хвороби*;&#160;</p>
<p style="position:absolute;top:746px;left:556px;white-space:nowrap" class="ft214"><b>•</b></p>
<p style="position:absolute;top:746px;left:562px;white-space:nowrap" class="ft213">&#160;при повторному взятті мазка через короткий проміжок&#160;</p>
<p style="position:absolute;top:761px;left:556px;white-space:nowrap" class="ft221">часу (день в день або через добу), що зменшує кількість&#160;<br/>біоматеріалу в зразку і в свою чергу може призводити&#160;<br/>до негативних результатів.<br/>При наявності цих факторів необхідно провести&#160;<br/>тестування методом ПЛР **.</p>
<p style="position:absolute;top:855px;left:131px;white-space:nowrap" class="ft213">&#160;</p>
<p style="position:absolute;top:870px;left:131px;white-space:nowrap" class="ft223">* Фактори ризику визначені&#160;«Наказ МОЗ України від 28.03.2020 р.&#160;№&#160;722»&#160;Організація надання медичної допомоги хворим&#160;<br/>на коронавірусну хворобу&#160;(COVID-19)»<br/>** Коронавірус&#160;(SARS-Cov-2), COVID-19,&#160;РНК методом&#160;RT-ПЛР-якісний,&#160;FTD&#160;(терміновий); Коронавірус&#160;(SARS-CoV-2), COVID-<br/>19,&#160;РНК методом&#160;RT-ПЛР - якісний&#160;<br/>*** Скринінг респіраторних інфекцій, ПЛР, 21 показник,&#160;FTD&#160;(високочутл.)</p>
<p style="position:absolute;top:973px;left:131px;white-space:nowrap" class="ft24"><b>&#160; &#160;ВАЖЛИВО!</b></p>
<p style="position:absolute;top:1001px;left:131px;white-space:nowrap" class="ft224"><b>Негативний тест на антиген не є підтвердженням відсутності вірусу у зразку біологічного матеріалу.&#160;<br/>ПЛР&#160;–&#160;високочутливий метод діагностики, який дозволяє виявити навіть невелику кількість вірусів у зразку мазка з&#160;<br/>рото-, носоглотки і визначити відносний рівень вірусного навантаження (кількість вірусів у зразку). Значення вірусного&#160;<br/>навантаження (ВН) є основним показником при оцінці заразності людини для оточуючих.</b></p>
